import React, {Component} from "react";
import "./mob.css";

class Mob extends Component{
    constructor(props){
        super(props)
        this.state = {
            cur_back: 0
        }
    }

    changeBack(){
        setTimeout(() => {
            let cur_back = this.state.cur_back + 1
            if (cur_back == 3){cur_back = 0}
            this.setState(state => ({
                cur_back: cur_back
            }))
            this.changeBack()
        }, 10000)
    }

    render(){
        return(
            <div className="mob">
                <div className="back"></div>
            </div>
        )
    }
}

export default Mob
